window.bookSummaryJSON = "<p>Hours after rejecting the Corrowa People’s native title claim on Brisbane’s Meston Park, Justice Bruce Brosnan is brutally murdered in his home. Days later, lawyers against the claim are also found dead.</p> <p>Aboriginal people were once prohibited from entering Brisbane’s city limits at night, and Meston Park stood on the boundary. The Corrowa’s matriarch, Ethel Cobb, is convinced the murders are the work of an ancient assassin who has returned to destroy the boundary, but Aboriginal lawyer Miranda Eversely isn't so sure. When the Premier is kidnapped, the pressure to find the killer intensifies....</p> <p>While the investigation forces Detective Sergeant Jason Matthews to confront his buried heritage, Miranda battles a sense of personal failure at the Corrowa’s defeat. How far will it take her to the edge of self-destruction?</p>"; 
